window.bookSummaryJSON = "<p><b>The final chapter...</b></p> <p>With his wife waging the fight of her life, Jason is desperate to get home, Blue Wolf or not.&nbsp;</p> <p>But DAWA, an advanced warning system for doomsday events, has just sounded the alarm. A disease outbreak on tribal land is the latest in an ominous pattern that heralds the imminent end of the world.</p> <p>Faced with the death of billions, Jason and his team rush to a reservation in Florida to break the pattern, only to confront a ghastly disease that can’t be cured and a source that appears supernatural. And unstoppable.</p> <p>Now, with the doomsday pattern gaining momentum, Jason must forge new alliances and rally his team one final time. Because, what’s coming is backed by the power of prophecy and more terrible than anything he’s ever fixed in his crosshairs.&nbsp;</p> <p>Win or lose, this <i>will</i> be the Blue Wolf’s last mission.&nbsp;</p>"; 
